import React, {Component} from 'react';
import {Link} from "react-router-dom";

class Navbar extends Component {
    constructor(props) {
        super(props);
        this.state = {active: ''}
        console.log(window.location.href)
    }

    doClickToggler() {
        if (this.state.active === 'active') {
            this.setState({active: ''});
        } else {
            this.setState({active: 'active'});
        }
    }

    render() {
        return (
            <>
                <nav className="navbar fixed-bottom navbar-expand-lg navbar-light bg-light">
                    <div className="container">
                        <button className={`navbar-toggler ${this.state.active}`} onClick={() => this.doClickToggler()}
                                type="button" data-toggle="collapse"
                                data-target="#navbarSupportedContent"
                                aria-controls="navbarSupportedContent" aria-expanded="false"
                                aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"/>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul className="navbar-nav mr-auto">
                                <li className="nav-item">
                                    <Link className="nav-link" title="Home" to="/">Home</Link>
                                </li>
                                <li className="nav-item font-weight-bold">
                                    <Link className="nav-link" title="portfolio" to='/project'>Project</Link>
                                </li>
                                <li className="nav-item">
                                    <Link to='/contact' className="nav-link">contact
                                        me</Link>
                                </li>
                            </ul>
                        </div>
                    </div>
                </nav>
            </>
        );
    }
}

export default Navbar;
